Review.create!({user_id: 1, workspace_id: 1, body: "This is a great space ranging from co-working space, free wifi, AWS technical help, bootcamps or evening events. Highly recommend stopping by. They have free drinks & snacks too!",
                overall: 5, wifi: 5, power: 5, seating: 5, pricing: 1})
Review.create!({user_id: 2, workspace_id: 1, body: "They offer a lot of tech courses for their software. I came here for a party and I am going to another party this Thurs. Conclusion: AWS throws parties and they are pretty awesome, so you should go too. Drinks, appetizers, free swag.",
                overall: 5, wifi: 5, power: 5, seating: 4, pricing: 1})

Review.create!({user_id: 4, workspace_id: 1, body: "I like the fast wireless connection (SSID: AWS 5) - look at the whiteboards or ask for the wireless password.  It is a very clean and safe atmosphere here.  Extremely comfortable to hang out in and work on whatever project you are working on.  GREAT MEETING PLACE!  My friend and I even ordered some food while here through SPRIG and got it delivered very timely.  It only cost me roughly $4 with a promotional $10 credit.  It is very close to Union Sq., so I might hang out here every once in a while even on the weekend.",
overall: 5, wifi: 5, power: 5, seating: 4, pricing: 1})

Review.create!({user_id: 3, workspace_id: 2, body: "I love love this place, especially since there are various Chai Tea to enjoy! I tried the Tiger Chai Tea, and it's definitely my favorite chai tea ever. I recommend trying this, along with the Cub or Elephant chai, too.
Next time, I would love to try out the Speakeasy beer with chai spices. I love Speakeasy, so it would be interesting to try one out with their chai spices. I didn't get to try one today because it was sold out already. Must be really popular drink from there, too! I would love to come here again and hang out longer.",
overall: 3, wifi: 3, power: 2, seating: 2, pricing: 3})

Review.create!({user_id: 1, workspace_id: 2, body: "Yum vanilla chai tea, best boba I have had by far.

Ya feel me?",
overall: 3, wifi: 3, power: 1, seating: 2, pricing: 1})

Review.create!({user_id: 5, workspace_id: 3, body: "Excellent Lox Bagel.  Also, brand new paint on the walls.  This place is really stepping up to be a great location for sipping coffee with your buddies and getting work done on your laptop.",
overall: 2, wifi: 5, power: 3, seating: 4, pricing: 2})

Review.create!({user_id: 4, workspace_id: 3, body: "Good coffee, but interior could be cozier and better.",
overall: 2, wifi: 2, power: 2, seating: 1, pricing: 1})

Review.create!({user_id: 2, workspace_id: 4, body: "Great guy just took over the biz! Owner of Golo Cafe, and also sells amazing homemade bread at Civic Center Farmers Market. I expect good things.
NOTE: It is now called Caffe Trinity.",
overall: 5, wifi: 3, power: 1, seating: 1, pricing: 1})
Review.create!({user_id: 5, workspace_id: 4, body: "I absolutely love this cafe! Great staff, really fancy decor and great coffee! Also, unlike most overrated places in SF with a queue outside, this place is relatively quiet. So, shh, keep it secret.

I have my morning coffee here every morning btw.",
overall: 5, wifi: 4, power: 1, seating: 1, pricing: 2})
Review.create!({user_id: 3, workspace_id: 5, body: "
Their toast are amazing! If you want a savory toast go with the truffled toast! And if you want something more sweet for breakfast, the condensed milk toast is the one! I ordered both so I can get the best of both world. And the condensed milk one is just amazing!",
overall: 3, wifi: 4, power: 5, seating: 2, pricing: 1})
Review.create!({user_id: 4, workspace_id: 5, body: "I love home! The toast is awesome (have you ever eaten something that buttery delicious?) the service is great, and the environment is relaxing.

Only gripe I have is that they don't open earlier! I'd love to be able to grab some toast and coffee before heading to work.",
overall: 5, wifi: 5, power: 3, seating: 4, pricing: 1})
Review.create!({user_id: 2, workspace_id: 6, body: "Great experience, people were friendly, food was delicious, only negative is that space is (really) tight, the whole restaurant is one room, (kitchen included).
Will be a shock if you're a tourist, but worth it anyway...",
overall: 5, wifi: 3, power: 2, seating: 4, pricing: 1})
Review.create!({user_id: 1, workspace_id: 6, body: "The toast cups are absolutely amazing and the iced coffee is straight jet fuel. You have to stop here for breakfast. Super pleasant staff makes it even better.
Plan on getting your food to go. The place is super tiny.",
overall: 5, wifi: 5, power: 5, seating: 4, pricing: 1})
Review.create!({user_id: 5, workspace_id: 7, body: "Atmosphere- it's warm, Pepe the owner is really nice and strikes up a great conversation. He is also good about switching to your favorite sports team

Coffee- French press so if you're not ok with that, get an americano

Other drinks- iced tea is my bffs favorite. Green tea frappe has no matcha flavor and I wouldn't order that again",
overall: 5, wifi: 5, power: 5, seating: 4, pricing: 1})
Review.create!({user_id: 4, workspace_id: 7, body: "Very, very solid coffee shop. I like this coffee shop enough to try and move into the area (also helps there's a bar down the way)! I ordered a Vanilla Latte and a Bacon, Egg and Cheese sandwich on a Everything Bagel and followed up with my usual drip coffee.",
overall: 5, wifi: 5, power: 5, seating: 4, pricing: 1})
Review.create!({user_id: 2, workspace_id: 8, body: "The place was pretty quiet at 9:00 on a Sunday morning. It was a nice spot to play catch-up. Service was friendly and there was ample seating. The space was charming, and there were lots of attractive pastries behind glass. I had a lovely cappuccino, lush with milk foam.

I gather Bernie's has free wifi, so between that and the warm atmosphere it's more or less an ideal neighborhood hangout. I'm sure it's well loved by the people of Noe Valley.",
overall: 4, wifi: 5, power: 2, seating: 4, pricing: 3})
Review.create!({user_id: 2, workspace_id: 8, body: "Cheap and non-pretentious for a coffee shop that offers free wifi! It is more cozy than luxurious but it is your avg mom and pop kind of coffee shop. Ummmm, more like friend and friend coffee shop.
What really adds to the 2 positives I notes above is the location and that right around it are esoteric shops which bring interesting people there.
Sip your coffee as you watch people and their pets walk by or read a book or work on your laptop!",
overall: 5, wifi: 5, power: 5, seating: 5, pricing: 1})
Review.create!({user_id: 3, workspace_id: 9, body: "I am in love! I stumbled upon this place last week and luckily chose to get my almond latte in house, which I never do as I am always on the go go go. But, I stayed for over three hours, doing some journaling and enjoying the pleasant atmosphere... and pondering life, and having multiple lattegasms, etc. The people who craft these amazing lattes are magicians of the highest order, obviously! I will defiantly keep coming, as often as possible,perhaps even go wild and order some food next time- it aways smells relish!
xoxo

oh, et ps: music is always on point!",
overall: 5, wifi: 5, power: 2, seating: 4, pricing: 1})
Review.create!({user_id: 2, workspace_id: 9, body: "I had a rough morning at work, and decided to treat myself to lunch at Reveille Coffee.  I ordered the Chinese chicken salad, which was $12.50.  It turned out to be a pretty big salad, probably good for two people if they weren't too hungry.  Even though I was starving, I found myself to be really full after eating 3/4 of it.",
overall: 3, wifi: 4, power: 5, seating: 2, pricing: 1})
Review.create!({user_id: 1, workspace_id: 10, body: "I was in the area and found Artis coffee out of the blue. It's a really cool neighborhood coffeehouse that stays true to San Francisco since it is located below apartments.  What a treat for the residence who just walk a few steps and sip one of the freshest brewed coffee. ",
overall: 3, wifi: 5, power: 5, seating: 4, pricing: 3})
Review.create!({user_id: 5, workspace_id: 10, body: "I was so mad that I forgot to use my 10% check-in offer!

I ordered the vanilla latte with almond milk...it was tasty!  Not the greatest coffee I have had but I appreciate that they make their own vanilla. Great place to get work done with secured Internet.

Would prolly return again to do work and enjoy more coffee.",
overall: 2, wifi: 4, power: 5, seating: 4, pricing: 3})
Review.create!({user_id: 3, workspace_id: 11, body: "Bean Bag has one of the best inexpensive beer happy hours in Alamo Square.  Over a handful of quality draft beer for $2.50 up until 10pm! The crepes are delicious also- try the chicken pesto.

Seating is sparse- especially outside where you may find a few broken chairs- but the people watching is prime.",
overall: 5, wifi: 5, power: 5, seating: 4, pricing: 1})
Review.create!({user_id: 1, workspace_id: 11, body: "Came here for breakfast with my friend.

I love this place! Originally we wanted to eat there but changed our minds after we have placed our orders. I ordered the basic Crepe with salad. The friendly employee handed me my food with a smile and asked if I wanted utensils, or condiments.

The food is absolutely delicious. If I am ever in the neighborhood I will have to stop by again.",
overall: 5, wifi: 5, power: 5, seating: 4, pricing: 1})
Review.create!({user_id: 3, workspace_id: 12, body: "Chill little coffee place in the glen park district. It was my first time coming here. When i came here to meet a friend to catch up, good among of people walk and in out of this place. Seems popular to the local. ",
overall: 3, wifi: 2, power: 5, seating: 4, pricing: 1})
Review.create!({user_id: 1, workspace_id: 12, body: "As a Glen Park resident, I happened to want a neighborhood, sit-down coffee this morning.  The angry looking thirty-something Caucasian guy at the counter was RUDE and unfriendly, got my order wrong (left it in the microwave), unapologetic, stressed -- and I left knowing with full conviction that Canyon (friendly, nice, appreciative) is where I'll go from here on out. ",
overall: 2, wifi: 3, power: 2, seating: 4, pricing: 1})
Review.create!({user_id: 4, workspace_id: 13, body: "In pursuing my quest for the best bubble tea this summer, I discovered this gem. It's my favorite in SF!
My go-to drink is the Salted Caramel tea with tapioca - 50% sweet, with almond milk. So delicious!!!
It's a quaint little shop, very simple and clean, and the staff are wonderful. They even remembered who we were after only going 2-3 times.
Highly recommend!",
overall: 5, wifi: 5, power: 5, seating: 5, pricing: 1})
Review.create!({user_id: 2, workspace_id: 13, body: "Really cute place on Geary near USF. They have Boba here!! I got a matcha green tea latte with boba and it was delish!!! Few people study here, but the tables are small so it would be hard to accommodate large groups. Nice and quiet  they also have a few seating areas outside. I think that will be nice when the weather is warm.",
overall: 5, wifi: 5, power: 5, seating: 5, pricing: 1})
Review.create!({user_id: 3, workspace_id: 14, body: "I love coming here to grab a cup of coffee and a snack or a sandwich. I've gotten the iced coffee and iced Americano here and both were pretty good. I need to try their other coffee drinks! But I really dig this place for their food! Their ham and cheese croissant is DA BOMB.COM. And also the last time I came here I got a lox sandwich for lunch and ugh omg so delicious. when I die bury me with a lox sandwich in hand. They have a ton of different sandwich and pastry choices and lunch specials and everything looks delicious. ",
overall: 3, wifi: 1, power: 4, seating: 5, pricing: 2})
Review.create!({user_id: 1, workspace_id: 14, body: "The coffee shop itself is pretty spacious. There's a nice outdoor seating area with tables and umbrellas. Inside, the space has high ceilings and tons of seating. It would definitely be a great place to study or do work. It's usually pretty quiet and laid back. Definitely check this place out if you want some caffeine, delicious food, and a nice place to chill!",
overall: 3, wifi: 3, power: 3, seating: 3, pricing: 3})
Review.create!({user_id: 5, workspace_id: 15, body: "Love the decor

Was there before the current owner

Ms Pac Man table

I lived across the street for 2 weeks, and went here every morn",
overall: 2, wifi: 5, power: 5, seating: 3, pricing: 3})
Review.create!({user_id: 2, workspace_id: 15, body: "Atmosphere is cute but the coffee was wayy too sweet
I got an iced caramel machiatto and all i tasted was the sweetener :c i usually like sweet things but this tasted like sugar water
The pumpkin cream cheese cupcake i got was at least pretty good ~",
overall: 3, wifi: 3, power: 3, seating: 4, pricing: 2})
Review.create!({user_id: 4, workspace_id: 16, body: "Really love this place. my almond milk latte was light and airy but still very flavorful. I have been here twice in the last month and have been impressed but visits. Will definitely come again.",
overall: 2, wifi: 4, power: 5, seating: 4, pricing: 1})
Review.create!({user_id: 1, workspace_id: 16, body: "Pretty good coffee and friendly baristas, but for me, the best thing about this place is the plentiful outlets and seating (as long as you don't go during peak weekend hours), and the reliable WiFi. It's dark inside unlike a lot of other hipster coffee shops in the city, but comfortable.",
overall: 5, wifi: 5, power: 5, seating: 3, pricing: 4})


